import React from 'react';
import './HomeMain.css';
import { Link, useLocation } from 'react-router-dom';


const HomeMainbar =() =>{
    return(
        <div className='Home' >
        <div className='HomeHeading'>
        <h1 className='AllHeading'>All Questions</h1>
        <button class='AskButton' type="submit"> Ask Question</button>
        </div>
        </div>)
}

export default HomeMainbar;
